import React from "react";

import "./App.css";
import Login from "./pages/Login";

class App extends React.Component {
  state = {
    person: [
      { name: "ali", age: 33 },
      { name: "mo", age: 2 },
      { name: "so", age: 30 },
    ],
    otherState: "hala harchi ",
  };

  switchNameHandler = () => {
    // console.log("its working");
    this.setState({
      person: [
        { name: "has", age: 323 },
        { name: "mo", age: 2 },
        { name: "so", age: 0 },
      ],
    });
  };
  switchHandler = () => {
    // console.log("its working");
    this.setState({
      person: [
        { name: "mmmmmmmmmm", age: 323 },
        { name: "ssssssmo", age: 2 },
        { name: "ssssssssso", age: 0 },
      ],
    });
  };
  nameChangeHandlre = (event) => {
    this.setState({
      person: [
        { name: "mmmmmmmmmm", age: 323 },
        { name: event.target.value, age: 2 },
        { name: "ssssssssso", age: 0 },
      ],
    });
  };

  render() {
    return (
      <div className="App">
        <Login />
      </div>
    );
  }
}

export default App;
